import React from "react";
import "./SettingsPage.css"
const SettingsPage = () => {
    return(
        <div className="SettingsPage">
            <h1>Manage Account</h1>
            <h1>Sign Out</h1>
            <h1>Delete Account</h1>
        </div>
    )
}

export default SettingsPage;
